COSBase cosBase = acquireItem( j );
if (cosBase instanceof COSFloat)
{
    COSFloat cosNumber = (COSFloat)cosBase;
    result[j] = cosNumber.floatValue();
}
else if (cosBase instanceof COSInteger)
{
    COSInteger cosNumber = (COSInteger)cosBase;
    result[j] = cosNumber.intValue();
}

